INSERT INTO `sync_datascript` VALUES ('0001', 'ร้อยละของเด็กอายุ 0-3 ปี มีพัฒนาการสมวัย  (มากกว่าร้อยละ  85)', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_target=concat(@rep_year-3,\'1001\');\r\nset @edate_target=concat(@rep_year,\'0930\');\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect \'00200\' as kpi,@rep_year,nu.hospcode,@provcode,(select distcode from chospital where hoscode=nu.hospcode) as ampcode,\r\n(select count(distinct p.pid)       \r\nfrom   person p use index(idx6)\r\nwhere   p.discharge = \'9\' and p.typearea in (\'1\', \'3\') and p.nation =\'099\' \r\n            and p.birth between @bdate_target and @edate_target\r\n            and p.hospcode = nu.hospcode\r\n) as target,\r\n          sum(right(cast(date_develop as char),1) = 1) as total,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 10) and (right(cast(date_develop as char),1) = 1),1,0)) as mon10,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 11) and (right(cast(date_develop as char),1) = 1),1,0)) as mon11,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 12) and (right(cast(date_develop as char),1) = 1),1,0)) as mon12,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 1) and (right(cast(date_develop as char),1) = 1),1,0)) as mon1,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 2) and (right(cast(date_develop as char),1) = 1),1,0)) as mon2,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 3) and (right(cast(date_develop as char),1) = 1),1,0)) as mon3,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 4) and (right(cast(date_develop as char),1) = 1),1,0)) as mon4,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 5) and (right(cast(date_develop as char),1) = 1),1,0)) as mon5,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 6) and (right(cast(date_develop as char),1) = 1),1,0)) as mon6,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 7) and (right(cast(date_develop as char),1) = 1),1,0)) as mon7,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 8) and (right(cast(date_develop as char),1) = 1),1,0)) as mon8,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 9) and (right(cast(date_develop as char),1) = 1),1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom  \r\n( select  n.hospcode,n.pid,\r\n  substring_index(group_concat(date_serv,\'| \' ,childdevelop  order by   date_serv  desc  separator \'||\'    ),    \'||\',    1  )  date_develop\r\n  from  nutrition n,person p\r\n  where  date_serv between @bdate_result and @edate_result \r\n             and p.discharge = \'9\' and p.typearea in (\'1\', \'3\') and p.nation =\'099\' \r\n             and p.birth between @bdate_target and @edate_target\r\n             and p.hospcode = n.hospcode and n.pid = p.pid\r\n  group by   n.hospcode, n.pid\r\n) as nu\r\ngroup by nu.hospcode', 'kpi_type_total', '2015-05-29 11:28:19', null, null, '0', 'r00200', '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0002', 'ร้อยละของเด็ก 0-3 ปี ได้รับวัคซีน MMR ตามเกณฑ์ (มากกว่าร้อยละ  95)', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_target=concat(@rep_year-3,\'1001\');\r\nset @edate_target=concat(@rep_year-1,\'0930\');\r\n\r\n\r\nselect \'00300\' as kpi,@rep_year,p.hospcode,@provcode,(select distcode from chospital where hoscode=p.hospcode) as ampcode,\r\n          count(distinct p.pid) as target,\r\n          sum(if(isnull(e.date_serv),0,1)) as total,\r\n          sum(if(month(e.date_serv) =10,1,0)) as mon10,\r\n          sum(if(month(e.date_serv) =11,1,0)) as mon11,\r\n          sum(if(month(e.date_serv) =12,1,0)) as mon12,\r\n          sum(if(month(e.date_serv) =1,1,0)) as mon1,\r\n          sum(if(month(e.date_serv) =2,1,0)) as mon2,\r\n          sum(if(month(e.date_serv) =3,1,0)) as mon3,\r\n          sum(if(month(e.date_serv) =4,1,0)) as mon4,\r\n          sum(if(month(e.date_serv) =5,1,0)) as mon5,\r\n          sum(if(month(e.date_serv) =6,1,0)) as mon6,\r\n          sum(if(month(e.date_serv) =7,1,0)) as mon7,\r\n          sum(if(month(e.date_serv) =8,1,0)) as mon8,\r\n          sum(if(month(e.date_serv) =9,1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom   person p use index(idx6), epi e use index(idx1)\r\n\r\nwhere  p.discharge = \'9\' and p.typearea in (\'1\', \'3\') and p.nation =\'099\' \r\n             and p.birth between @bdate_target and @edate_target\r\n             and p.hospcode = e.hospcode and p.pid = e.pid\r\n             and e.vaccinetype = \'061\'\r\ngroup by   p.hospcode', 'kpi_type_total', '2015-05-29 12:22:09', null, null, '0', 'r00300', '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0003', 'รายงานจำนวนการส่งต่อผู้ป่วยนอกจังหวัด', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\n\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect \'01100\' as kpi,@rep_year,service.hospcode,@provcode,(select distcode from chospital where hoscode=service.hospcode) as ampcode,\r\n          0 as target,\r\n          count(*) as total,\r\n          sum(if(month(service.date_serv) =10,1,0)) as mon10,\r\n          sum(if(month(service.date_serv) =11,1,0)) as mon11,\r\n          sum(if(month(service.date_serv) =12,1,0)) as mon12,\r\n          sum(if(month(service.date_serv) =1,1,0)) as mon1,\r\n          sum(if(month(service.date_serv) =2,1,0)) as mon2,\r\n          sum(if(month(service.date_serv) =3,1,0)) as mon3,\r\n          sum(if(month(service.date_serv) =4,1,0)) as mon4,\r\n          sum(if(month(service.date_serv) =5,1,0)) as mon5,\r\n          sum(if(month(service.date_serv) =6,1,0)) as mon6,\r\n          sum(if(month(service.date_serv) =7,1,0)) as mon7,\r\n          sum(if(month(service.date_serv) =8,1,0)) as mon8,\r\n          sum(if(month(service.date_serv) =9,1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom service \r\ninner join chospital on chospital.hoscode=service.hospcode\r\ninner join person on person.hospcode=service.hospcode and person.pid=service.pid\r\nleft join diagnosis_opd on diagnosis_opd.hospcode=service.hospcode and diagnosis_opd.pid=service.pid \r\n           and diagnosis_opd.date_serv=service.date_serv\r\nwhere service.date_serv between @bdate_result and @edate_result\r\nand service.typeout=\'3\' \r\nand chospital.hostype in (\'05\',\'06\',\'07\')\r\nand (service.referouthosp in(\'10741\',\'10713\',\'10710\',\'12275\',\'11320\',\'11304\',\'11040\',\'10712\',\'10711\',\r\n \'28879\',\'24085\',\'23951\',\'14923\',\'14717\',\'14663\',\'14644\',\'14203\',\'14201\',\'14199\',	\'14197\',\'14196\',\'14195\',\'14195\',\'14171\',\'13785\',\'13775\',\'13760\',\'13755\',\'12439\',			\'12438\',\'12290\',\'12289\',\'12287\',\'12286\',\'12284\',\'12258\',\'12257\',\'12256\',\'12252\',\r\n\'12283\',\'12281\',\'12280\',\'12279\',\'12278\',\'12277\',\'12276\',\'12273\',\'12272\',\'12262\',\r\n\'12260\',\'12251\',\'12250\',\'12249\',\'12246\',\'12244\',\'12243\',\'11579\',\'11473\',\'28005\',\r\n\'25060\',\'25049\',\'24976\',\'24748\',\'24678\',\'23987\',\'23974\',\'23762\',\'23560\',\'23429\',\r\n\'22952\',\'22737\',\'21771\',\'15229\',\'15199\',\'15198\',\'15140\',\'15149\',\'14933\',\r\n\'14928\',\'14919\',\'14918\',\'14904\',\'14901\',\'14862\',\'14689\',\'14641\',\'14584\',\'14465\',\r\n\'14173\',\'14161\',\'14160\',\'13815\',\'13814\',\'13766\',\'13758\',\'13757\',\'13756\',\'13754\',\r\n												 \'13753\',\'12472\',\'12471\',\'12456\',\'12454\',\'12453\',\'11978\',\'11946\',\'11514\',\'11513\',\r\n\'11512\',\'11468\',\'11305\' )\r\nor service.referouthosp between \'10660\' and \'10684\'\r\nor service.referouthosp between \'10742\' and \'10751\'\r\nor service.referouthosp between \'10714\' and \'10740\'\r\nor service.referouthosp between \'10685\' and \'10709\'\r\nor service.referouthosp between \'12266\' and \'12270\'\r\nor service.referouthosp between \'11469\' and \'11473\'\r\nor service.referouthosp between \'13777\' and \'13781\'\r\nor service.referouthosp between \'11525\' and \'11541\'\r\nor service.referouthosp between \'11516\' and \'11523\'\r\nor service.referouthosp between \'11504\' and \'11510\'\r\nor service.referouthosp between \'11475\' and \'11502\' )\r\nand service.referouthosp not in (\'11498\',\'11489\',\'11488\',\'11480\')\r\nand service.referouthosp not in (\'10676\',\'10673\',\'10727\',\'10725\',\'10724\',\'10723\',\'10722\')\r\nand service.referouthosp not in (\'11244\',\'11245\',\'11246\',\'11247\',\'11248\',\'11249\',\'11250\')\r\n\r\nand left(diagnosis_opd.diagcode,3) between \'V01\' and \'V89\'\r\ngroup by service.hospcode\r\n', 'kpi_type_total', '2015-06-02 09:28:26', null, null, '0', 'm01100', '1', '0', null);
