ate_develop as char),1) = 1),1,0)) as mon5,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 6) and (right(cast(date_develop as char),1) = 1),1,0)) as mon6,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 7) and (right(cast(date_develop as char),1) = 1),1,0)) as mon7,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 8) and (right(cast(date_develop as char),1) = 1),1,0)) as mon8,\r\n          sum(if((month(substring_index(cast(date_develop as char),\'|\',1) ) = 9) and (right(cast(date_develop as char),1) = 1),1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom  \r\n( select  n.hospcode,n.pid,\r\n  substring_index(group_concat(date_serv,\'| \' ,childdevelop  order by   date_serv  desc  separator \'||\'    ),    \'||\',    1  )  date_develop\r\n  from  nutrition n,person p\r\n  where  date_serv between @bdate_result and @edate_result \r\n             and p.discharge = \'9\' and p.typearea in (\'1\', \'3\') and p.nation =\'099\' \r\n             and p.birth between @bdate_target and @edate_target\r\n             and p.hospcode = n.hospcode and n.pid = p.pid\r\n  group by   n.hospcode, n.pid\r\n) as nu\r\ngroup by nu.hospcode', 'kpi_type_total', '2015-06-05 11:54:42', null, null, '0', 'm00200', '1', '0', null);
