INSERT INTO `sync_datascript` VALUES ('0006', 'จำนวนผู้มารับบริการผู้ป่วยนอก', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\n\r\n\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect \'00100\' as kpi,@rep_year,service.hospcode,@provcode,(select distcode from chospital where hoscode=service.hospcode) as ampcode,\r\n          0 as target,\r\n          count(*) as total,\r\n          sum(if(month(service.date_serv) =10,1,0)) as mon10,\r\n          sum(if(month(service.date_serv) =11,1,0)) as mon11,\r\n          sum(if(month(service.date_serv) =12,1,0)) as mon12,\r\n          sum(if(month(service.date_serv) =1,1,0)) as mon1,\r\n          sum(if(month(service.date_serv) =2,1,0)) as mon2,\r\n          sum(if(month(service.date_serv) =3,1,0)) as mon3,\r\n          sum(if(month(service.date_serv) =4,1,0)) as mon4,\r\n          sum(if(month(service.date_serv) =5,1,0)) as mon5,\r\n          sum(if(month(service.date_serv) =6,1,0)) as mon6,\r\n          sum(if(month(service.date_serv) =7,1,0)) as mon7,\r\n          sum(if(month(service.date_serv) =8,1,0)) as mon8,\r\n          sum(if(month(service.date_serv) =9,1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom service\r\ninner join chospital on chospital.hoscode=service.hospcode\r\nwhere   service.date_serv between @bdate_result and @edate_result        \r\nand  chospital.provcode = @provcode and chospital.hostype  in (\'05\',\'06\',\'07\')\r\nGROUP BY service.hospcode;', 'kpi_type_total', '2015-06-05 11:50:12', null, null, '0', 't00100', '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0007', 'จำนวนผู้มารับบริการผู้ป่วยใน', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect \'00200\' as kpi,@rep_year,admission.hospcode,@provcode,(select distcode from chospital where hoscode=admission.hospcode) as ampcode,\r\n          0 as target,\r\n          count(*) as total,\r\n          sum(if(month(admission.DATETIME_ADMIT) =10,1,0)) as mon10,\r\n          sum(if(month(admission.DATETIME_ADMIT) =11,1,0)) as mon11,\r\n          sum(if(month(admission.DATETIME_ADMIT) =12,1,0)) as mon12,\r\n          sum(if(month(admission.DATETIME_ADMIT) =1,1,0)) as mon1,\r\n          sum(if(month(admission.DATETIME_ADMIT) =2,1,0)) as mon2,\r\n          sum(if(month(admission.DATETIME_ADMIT) =3,1,0)) as mon3,\r\n          sum(if(month(admission.DATETIME_ADMIT) =4,1,0)) as mon4,\r\n          sum(if(month(admission.DATETIME_ADMIT) =5,1,0)) as mon5,\r\n          sum(if(month(admission.DATETIME_ADMIT) =6,1,0)) as mon6,\r\n          sum(if(month(admission.DATETIME_ADMIT) =7,1,0)) as mon7,\r\n          sum(if(month(admission.DATETIME_ADMIT) =8,1,0)) as mon8,\r\n          sum(if(month(admission.DATETIME_ADMIT) =9,1,0)) as mon9,\r\n          0.00 as ratio  \r\nfrom admission\r\ninner join chospital on chospital.hoscode=admission.hospcode\r\nwhere   admission.DATETIME_ADMIT between @bdate_result and @edate_result        \r\nand  chospital.provcode = @provcode and chospital.hostype  in (\'05\',\'06\',\'07\')\r\nGROUP BY admission.hospcode;', 'kpi_type_total', '2015-06-05 11:54:58', null, null, '0', 't00200', '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0008', 'CMI', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\n\r\nselect \'00300\' as kpi,@rep_year,hospcode,@provcode,          \r\n  sumcase,\r\n  sumadjrw,\r\n  splevel,\r\n  refcmi,\r\n  pctlowcmi,\r\n  cntm10,\r\n  sumadjm10,\r\n  cntm11,\r\n  sumadjm11,\r\n  cntm12,\r\n  sumadjm12,\r\n  cntm01,\r\n  sumadjm01,\r\n  cntm02,\r\n  sumadjm02,\r\n  cntm03,\r\n  sumadjm03,\r\n  cntm04,\r\n  sumadjm04,\r\n  cntm05,\r\n  sumadjm05,\r\n  cntm06,\r\n  sumadjm06,\r\n  cntm07,\r\n  sumadjm07,\r\n  cntm08,\r\n  sumadjm08,\r\n  cntm09,\r\n  sumadjm09\r\nfrom s_cmi_summary_region cmi\r\nwhere   cmi.b_year-543 = @rep_year;      ', 'kpi_cmi', '2015-06-05 11:46:04', null, null, '0', 't00300', '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0009', '10 อันดับผู้ป่วยนอก', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect @rep_year,@provcode,d.diagcode,c.diseasethai,count(*) as total\r\nfrom diagnosis_opd d\r\ninner join cdisease c on d.diagcode = c.diagcode\r\nwhere d.diagcode not like \'Z%\'\r\nand d.date_serv between  @bdate_result and @edate_result\r\ngroup by d.diagcode\r\norder by total desc limit 10', 'dashboard_top10_opd', '2015-06-18 11:28:11', null, null, '0', null, '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0010', '10 อันดับผู้ป่วยใน', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930235959\');\r\n\r\nselect @rep_year,@provcode,d.diagcode,c.diseasethai,count(*) as total\r\nfrom diagnosis_ipd d\r\ninner join cdisease c on d.diagcode = c.diagcode\r\nwhere d.diagcode not like \'Z%\'\r\nand d.datetime_admit between  @bdate_result and @edate_result\r\ngroup by d.diagcode\r\norder by total desc limit 10', 'dashboard_top10_ipd', '2015-06-18 11:29:17', null, null, '0', null, '1', '0', null);
INSERT INTO `sync_datascript` VALUES ('0011', '4 กลุ่มโรค 504', 'set @rep_year = :rep_year;\r\nset @provcode = :provcode;\r\nset @bdate_result =concat(@rep_year-1,\'1001\');\r\nset @edate_result =concat(@rep_year,\'0930\');\r\n\r\nselect @rep_year,@provcode,sum(if(d.DIAGCODE BETWEEN \'C00\' and \'C9799\' or d.DIAGCODE BETWEEN \'D00\' and \'B4899\',1,0) ) as total1, \r\n          sum(if(d.DIAGCODE BETWEEN \'E00\' and \'E9999\' ,1,0) ) as total2,\r\n          sum(if(d.DIAGCODE BETWEEN \'I00\' and \'I9999\' ,1,0) ) as total3,\r\n          sum(if(d.DIAGCODE BETWEEN \'M00\' and \'M9999\' ,1,0) ) as total4\r\nfrom diagnosis_opd d\r\nwhere  d.date_serv between  @bdate_result and @edate_result', 'dashboard_504', '2015-06-18 13:09:46', null, null, '0', null, '1', '0', null);
